import react from "react";
import stlyes from "./Header.module.css";

const Header = () => {
  return (
    <react.Fragment>
      <header className={stlyes.header}>
        ReactMeals
        <cart>cart</cart>
      </header>
      <img src="./meals.jpg"></img>
    </react.Fragment>
  );
};

export default Header;
